import { useState } from 'react';

const Navbar = (props) => {
  const [toggle, setToggle] = useState(false);
  return (
    <div className='navBar'>
      <button onClick={setToggle}>
        <FaAlignRight />
      </button>
      <ul className={toggle ? 'nav-links show-nav' : 'nav-links'}>
        <li href='#'>Home</li>
        <li href='#'>About us</li>
        <li href='#'>Contact</li>
      </ul>
    </div>
  );
};

export default Navbar;
